import React from 'react'
import ShopData from './shop.data'

class ShopPage extends React.Component{
    constructor(){
        super()
        this.state={
            collection:[ShopData]
        }
    }

    render(){
        return(
            <div>Shop Page</div>
        )
    }
}

export default ShopPage;
